import React from 'react'

export const JournalEntry = () => {
    return (
        <div className="journal__entry">
            <div 
                className="journal__entrypicture"
                style={{
                    backgroundSize: 'cover',
                    backgroundImage: 'url(https://i.blogs.es/aa1b9a/luna-100mpx/450_1000.jpg)'
                }}
            >

            </div>
        </div>
    )
}
